Let’s talk 💄 m a k e u p 💄

You guys asked for this, so here ya go! Disclaimer- we are not looking at technique! Makeup artists beware… I am probably doing everything wrong… but this works for me! 

I am using all cream makeup here. It is my go to when my skin feels the least bit dry. Also, as we age, I feel like the powder based makeup can look drying. So…think dewey, creamy, hydrated, and youthful. This is more than I do most days, but I thought I’d give you the full run down. 😉

Products used:

@revisionskincare Intellishade Original
@bobbibrown Foundation Stick in Natural 
@westmanatelier Face Trace in Truffle
